import React from 'react';

import classes from './Respaldo.module.css';

const Respaldo = () => {
    return ( 
        <div className={classes.Respaldo}>
            <h2>Pasos:</h2>
            <div className={classes.main}>
                cuadrado representativo
            </div>
            <h2>Respaldo</h2>
        </div>
     );
}
 
export default Respaldo;
